import React from "react"
import "./App.css"
import Die from "./Die"


export default function App(){
  const arr = []
  for(let i=0;i<10;i++){
    arr[i]=Math.ceil(Math.random()*6 )
  }
  const diceValues = arr.map((val)=>{
    return <Die value={val} />
  })
  return (
    <div className="container">
      <main className="main">
        <div className="dice-container">
            {diceValues}
          </div>
      </main>
    </div>
  )
}
